crete structures.'),(65480,1234,'Computer Organization',3,'Programming in assembly language and understanding the macroarchitecture of a computer is emphasized. Fundamentals of digital systems are introduced, and the designs of various components used are investigated.'),(74538,1234,'Application Programming',3,'Advanced application development in a current object-oriented language. Introduction to the software life cycle, best programming practices, and modern development tools.'),(89738,1234,'Analysis of Algorithms',3,'Analysis of the performance of algorithms; discussion of programming techniques and data structures used in the writing of effective algorithms.'),(97876,1234,'Systems Programming',4,'A study of systems-level programming in a specific system (at present, Unix). Focus on concepts and tools to support the construction of systems programs.');
