CREATE DEFINER=`root`@`localhost` PROCEDURE `delete_enrollee`(IN sid INT, IN eid INT)
BEGIN
	DELETE
	FROM ENROLL
	WHERE STUDENT_ID=sid AND EVENT_ID=eid;
    
	IF (SELECT CLASS.CLASS_WAITLIST_POSITION
		FROM CLASS
        WHERE CLASS.EVENT_ID=eid) > 0
    THEN
    UPDATE ENROLL
    SET ENROLL_WAITLIST_FLAG='0'
    WHERE ENROLL.EVENT_ID=eid AND ENROLL.ENROLL_WAITLIST_FLAG='1'
    LIMIT 1;
                        
	UPDATE CLASS
    SET CLASS.CLASS_WAITLIST_POSITION=CLASS.CLASS_WAITLIST_POSITION-1
    WHERE CLASS.EVENT_ID=eid;
	END IF;
END ;;
DELIMITER ;
