CREATE DEFINER=`root`@`localhost` PROCEDURE `is_class_available`(OUT test BOOLEAN, IN eid INT)
BEGIN
	IF (SELECT CLASSROOM_MAX_CAPACITY
        FROM CLASSROOM
        WHERE CLASSROOM_ID=(SELECT CLASSROOM_ID
		                    FROM CLASS
		                    WHERE CLASS.EVENT_ID=eid)) <= (SELECT COUNT(enroll.EVENT_ID)
										                  FROM ENROLL
										                  WHERE enroll.EVENT_ID=eid)
	THEN
    SET test=0;
    ELSE
    SET test=1;
    END IF;
END ;;
